import React from 'react';
import '../css/home.css'
function Home(props) {
    return (
        <div className='box-check'>
           <button type="button" class="btn btn-info">Check in</button>
           <button type="button" class="btn btn-danger">Check in</button>
        </div>
    );
}

export default Home;
